# --- --- --- Pre-process images and create training set. --- --- ---
# Step1: Process raw training images, divide them into 3x3=9 sub training images.
# Step1: 处理原始的训练图片, 将其分为3x3的9张训练图片
def process_raw_training_images(input_folder = "raw_training", output_folder = "training"):
    os.makedirs(output_folder, exist_ok=True)
    for filename in os.listdir(input_folder):
        if filename.lower().endswith(('.png', '.jpg', '.jpeg')):
            img_path = os.path.join(input_folder, filename)
            img = Image.open(img_path)
            width, height = img.size
            w, h = width // 3, height // 3

            # Split into 3×3
            for i in range(3):
                for j in range(3):
                    left, upper = j * w, i * h
                    right, lower = (j + 1) * w, (i + 1) * h
                    crop = img.crop((left, upper, right, lower))

                    # Save sub-images.
                    base, ext = os.path.splitext(filename)
                    crop.save(os.path.join(output_folder, f"{base}_{i+1}_{j+1}{ext}"))
