# Rename training images：
# 重命名训练图片
def rename_training_set(prefix=classes[-1], folder='training/'+classes[-1], start_num=0):
    # get files in the folder
    files = [f for f in os.listdir(folder) if os.path.isfile(os.path.join(folder, f))]
    files.sort()

    # rename all files
    for i, filename in enumerate(files, start=start_num):
        ext = os.path.splitext(filename)[1]  # get extension (e.g. .jpg, .png, .txt)
        new_name = f"{prefix}-{i:03d}{ext}"  # e.g. xx-001.jpg
        src = os.path.join(folder, filename)
        dst = os.path.join(folder, new_name)
        os.rename(src, dst)
        print(f"rename: {filename} -> {new_name}")
    print("rename completed.")
