def display_image(img1, img2, img1_index, img2_index):
    plt.figure(figsize=(10, 5))

    # left image
    plt.subplot(1, 2, 1)
    plt.imshow(img1)
    plt.title(f"Image {img1_index}")
    plt.axis("off")

    # right image
    plt.subplot(1, 2, 2)
    plt.imshow(img2)
    plt.title(f"Image {img2_index}")
    plt.axis("off")

    plt.tight_layout()
