#  --- basic image process ---
# remove the white margins in images
def trim_whitespace(im):
    bg = Image.new(im.mode, im.size, (255, 255, 255))  # white background
    diff = ImageChops.difference(im, bg)
    bbox = diff.getbbox()
    if bbox:
        return im.crop(bbox)
    else:
        return im  # do not crop images if whole images are white.

def preprocess_image(path):
    with Image.open(path) as im:
        im = im.convert("RGB")
        im = trim_whitespace(im)
        #im = im.resize((256, 256))
        im = im.resize((106, 106)) # image size
        return im

def compute_hash(im):
    return imagehash.phash(im)  # alternative: average_hash or dhash

# --- for analysis  ---
def plot_bar_hash_diff(distances):
    counter = Counter(distances)

    # plot bar figure
    plt.figure(figsize=(8, 5))
    plt.bar(counter.keys(), counter.values(), color="skyblue", edgecolor="black")

    # setup x-axis, y-axis ranges
    max_dist = max(counter.keys())
    x_ticks = np.arange(0, max_dist + 1, 1)
    plt.xticks(x_ticks)
    y_max = max(counter.values())
    y_step = max(1, y_max // 10)
    plt.yticks(np.arange(0, y_max + y_step, y_step))

    plt.xlabel("pHash diff: Hamming Distance")
    plt.ylabel("Number of images")
    plt.title("Distribution of pHash diff")
    plt.grid(axis='y', linestyle='--', alpha=0.6)
    plt.tight_layout()
    plt.show()

# Step3: Delete duplicates.
# Step3: 删除训练集中的重复图片
def detect_duplicates(folder='training/'+classes[-1]):
    hashes = []
    deleted = 0
    to_delete = set()
    # --- Step 1: compute hash ---
    image_files = [os.path.join(folder, f) for f in os.listdir(folder) if f.lower().endswith(('.png', '.jpg', '.jpeg', '.bmp', '.tiff'))]
    #print(os.listdir(folder))
    for index, path in enumerate(image_files):
        try:
            #im = Image.open(path)
            im = preprocess_image(path)
            h = compute_hash(im)
            hashes.append(h)
        except Exception as e:
            print(f"Error loading {path}: {e}")

    # --- Step2: compare images with similar hashes ---
    # compute the distance between two hashes
    distances = []
    #for h1, h2 in itertools.combinations(hashes, 2):  # all possible pairs.
    #    distances.append(h1 - h2)
    index = 0
    for i in range(len(hashes)):
        for j in range(i + 1, len(hashes)):
            index += 1
            hash_distance = hashes[i] - hashes[j]
            distances.append(hash_distance)
            if hash_distance < 13:  # threshold 13: by analyzing class 'hat' using plot_bar_hash_diff()
                display_image(Image.open(image_files[i]), Image.open(image_files[j]), i, j)
                print(f"{index}: {i} vs {j}, distance: {hash_distance}.")
                to_delete.add(image_files[j])

    """
    # --- Step 3: move/delete duplicate images ---
    for path in to_delete:
        filename = os.path.basename(path)
        dst = os.path.join(deleted_folder, filename)
        shutil.move(path, dst)
        deleted += 1
        print(f"Moved duplicate to {deleted_folder}: {filename}")
    """
    print(f"\nDone, {deleted} duplicate images moved to '{deleted_folder}'.")
