# --- --- --- training classification models. --- --- ---
#image_classifier.h5: epoch = 100
def training():
    # training data path
    base_dir = "training"
    subfolders = [os.path.join(base_dir, d) for d in os.listdir(base_dir) if os.path.isdir(os.path.join(base_dir, d))]
    print(f"Found {len(subfolders)} class folders: ")
    for d in subfolders:
        print("   -", os.path.basename(d))

    # data augmentation
    data_augmentation = tf.keras.Sequential([
        layers.RandomFlip("horizontal_and_vertical"),
        layers.RandomRotation(0.3),
        layers.RandomZoom(0.2)
    ])

    # create training dataset and validation dataset
    train_ds = image_dataset_from_directory(
        base_dir,
        labels='inferred',
        label_mode='categorical',
        batch_size=32,
        image_size=(128, 128),
        shuffle=True,
        validation_split=0.2,
        subset="training",
        seed=42,
        interpolation='bilinear'
    )

    val_ds = image_dataset_from_directory(
        base_dir,
        labels='inferred',
        label_mode='categorical',
        batch_size=32,
        image_size=(128, 128),
        shuffle=True,
        validation_split=0.2,
        subset="validation",
        seed=42,
        interpolation='bilinear'
    )

    # class information
    class_names = train_ds.class_names
    num_classes = len(class_names)
    print("Detected classes:", class_names)
    with open("class_names.txt", "w") as f:
        f.write("\n".join(class_names))

    # performance optimization
    AUTOTUNE = tf.data.AUTOTUNE
    train_ds = train_ds.prefetch(buffer_size=AUTOTUNE)
    val_ds = val_ds.prefetch(buffer_size=AUTOTUNE)

    # compute class weights
    labels = []
    for images_batch, labels_batch in train_ds:
        labels.extend(np.argmax(labels_batch.numpy(), axis=1))

    class_weights_array = class_weight.compute_class_weight(
        'balanced', classes=np.arange(num_classes), y=labels
    )
    class_weights_dict = dict(enumerate(class_weights_array))
    print("Class weights:", class_weights_dict)

    # MobileNetV2 transfer learning
    base_model = MobileNetV2(
        input_shape=(128, 128, 3),
        include_top=False,
        weights='imagenet'
    )
    base_model.trainable = False  # freeze base model.

    model = models.Sequential([
        data_augmentation,
        layers.Rescaling(1./255),
        base_model,
        layers.GlobalAveragePooling2D(),
        layers.Dense(128, activation='relu'),
        layers.Dropout(0.5),
        layers.Dense(num_classes, activation='softmax')
    ])

    # compile, training model
    model.compile(
        optimizer=tf.keras.optimizers.Adam(learning_rate=1e-4),
        loss='categorical_crossentropy',
        metrics=['accuracy']
    )
    history = model.fit(
        train_ds,
        validation_data=val_ds,
        epochs=100,
        class_weight=class_weights_dict
    )

    model.save("models/image_classifier.h5")
    print("\nTraining complete! Model saved as 'image_classifier.h5'")

    # visualize training process
    plt.figure(figsize=(6,4))
    plt.plot(history.history['accuracy'], label='train_acc')
    plt.plot(history.history['val_accuracy'], label='val_acc')
    plt.legend()
    plt.title("Training Progress")
    plt.show()
