# --- --- --- predict --- --- ---
# predict downloaded local images with model: image_classifier.h5
def predict():
    # set parameters.
    MODEL_PATH = "models/image_classifier.h5"
    TEST_DIR = "test"
    OUTPUT_DIR = "predicted"
    IMG_SIZE = (128, 128)

    # load model and class names.
    model = load_model(MODEL_PATH)
    with open("class_names.txt", "r") as f:
        class_names = [line.strip() for line in f.readlines()]
    print("Loaded classes:", class_names)

    # create output folder.
    os.makedirs(OUTPUT_DIR, exist_ok=True)
    for cname in class_names:
        os.makedirs(os.path.join(OUTPUT_DIR, cname), exist_ok=True)

    # predict every image in test set.
    for filename in os.listdir(TEST_DIR):
        fpath = os.path.join(TEST_DIR, filename)
        if not os.path.isfile(fpath):
            continue

        # load image
        img = image.load_img(fpath, target_size=IMG_SIZE)
        img_array = image.img_to_array(img)
        img_array = np.expand_dims(img_array, axis=0) #/ 255.0

        # predict
        preds = model.predict(img_array, verbose=0)[0]
        pred_idx = np.argmax(preds)
        pred_label = class_names[pred_idx]
        print(f"{filename} → {pred_label} (prob={preds[pred_idx]:.3f})")

        # copy images to corresponding predicted folders.
        dest_path = os.path.join(OUTPUT_DIR, pred_label, filename)
        shutil.copy2(fpath, dest_path)
