# predict online base64 images with model: image_classifier.h5
def predict_base64_image(base64_str, model_path="models/image_classifier.h5", class_file="class_names.txt"):
    logging.getLogger('tensorflow').setLevel(logging.ERROR)
    os.environ['TF_CPP_MIN_LOG_LEVEL'] = '3'

    # remove prefix: "data:image/png;base64," or "data:image/jpeg;base64,"
    if "," in base64_str:
        base64_str = base64_str.split(",")[1]

    # decode Base64
    image_data = base64.b64decode(base64_str)
    raw_image = Image.open(io.BytesIO(image_data)).convert("RGB")

    # load model and class names
    model = load_model(model_path)
    with open(class_file, "r") as f:
        class_names = [line.strip() for line in f.readlines()]

    # generate 3x3 sub-images and predict
    width, height = raw_image.size
    w, h = width // 3, height // 3
    # Split into 3×3
    preds_list = []

    for i in range(3):
        for j in range(3):
            left, upper = j * w, i * h
            right, lower = (j + 1) * w, (i + 1) * h
            crop = raw_image.crop((left, upper, right, lower))

            # resize
            IMG_SIZE = (128, 128)
            crop_resized = crop.resize(IMG_SIZE)

            # convert to numpy array.
            img_array = image.img_to_array(crop_resized)
            img_array = np.expand_dims(img_array, axis=0)

            # predict class.
            preds = model.predict(img_array, verbose=0)[0]
            pred_idx = np.argmax(preds)
            pred_label = class_names[pred_idx]
            preds_list.append(pred_label)

    logging.getLogger('tensorflow').setLevel(logging.INFO)
    os.environ['TF_CPP_MIN_LOG_LEVEL'] = '0'

    #return preds_list
    return [index+1 for index in range(len(preds_list)) if preds_list[index] == 'clock']
